import './DoctorLogin.css';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function DoctorLogin() {
    const[signUp, setSignUp] = useState(false);
    const[signIn, setSignIn] = useState(false);
    const[username, setUsername] = useState("");
    const[password, setPassword] = useState("");
    const navigate = useNavigate();

    // Handle choice between sign up and sign in
    const handleChoice = (input) => {
        if (input === "sign up") {
            setSignUp(true);
        } else if (input === "sign in") {
            setSignIn(true);
        }
    }

    // Handle sign in logic (to be implemented)
    const handleSignIn = () => {

    }

    return (
        <div>
            <h1>Doctor</h1>
            {!signIn && !signUp ? (
                <div className="account-container">
                    <button className="account-button" onClick={() => handleChoice("sign in")}>Sign In</button>
                    <button className="account-button" onClick={() => handleChoice("sign up")}>Create An Account</button>
                </div>
            ): null}

            {signIn ? (
                <div>
                    <h2>Sign In</h2>
                    <form>
                        <label>Username:</label>
                            <input 
                                type="text"
                                value={username}
                                onChange={(e) => setUsername(e.target.value)}
                            />
                        <label>Password:</label>
                            <input 
                                type="password"
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}/>
                        <button onClick={handleSignIn} type="submit">Log in</button>
                    </form>
                    <button onClick={() => setSignIn(false)}>Back</button>
                </div>
            ) : null}

            {signUp ? (
                <div>
                    <h2>Sign Up</h2>
                    <form>
                        <label>Username:</label>
                            <input type="text"/>
                        <label>Password:</label>
                            <input type="password"/>
                        <button type="submit">Log in</button>
                    </form>
                    <button onClick={() => setSignUp(false)}>Back</button>
                </div>
            ) : null}
        </div>
    )
}
